// src/components/Dashboard.tsx

import React from 'react';
import { LineChart, AreaChart, BarChart } from '../component';
import DataLog from './DataLogs';

const Dashboard: React.FC = () => {
    return (
        <div className="grid grid-rows-3 gap-4 h-screen p-4">
            <div className="grid grid-cols-4 gap-4 h-2/3">
                <div className="col-span-1">
                    <LineChart />
                </div>
                <div className="col-span-1">
                    <AreaChart />
                </div>
                <div className="col-span-1">
                    <LineChart />
                </div>
                <div className="col-span-1">
                    <AreaChart />
                </div>

                <div className="col-span-2">
                    <BarChart />
                </div>
                <div className="col-span-2">
                    <BarChart />
                </div>
            </div>
            <div className="row-span-1 overflow-auto">
                <DataLog />
            </div>
        </div>
    );
};

export default Dashboard;
